import React from 'react';
import HeatMapChart from './charts/heatMapChart';
import { Box, Grid } from '@mui/material';

function Dashboard() {
  return (
    <Grid item>
      <HeatMapChart chartName="Digital Affinity" colors={["#FEDF89","#F79009","#B54708","#7A2E0E"]} />
      <HeatMapChart chartName="Personal Promotion Affinity" colors={["#A6F4C5","#12B76A","#027A48","#054F31"]} />
      <HeatMapChart chartName="Peer to Peer Affinity" colors={["#B9E6FE","#0BA5EC","#026AA2","#0B4A6F"]}/>
    </Grid>
  )
}

export default Dashboard
